import React from 'react'

export default class UploadImage extends React.Component{

  render(){
    return(
      <div>
        <form onSubmit={this.handleSubmit}>
          <label>Name:</label>
          <input type='text'/>
          <label>Description:</label>
          <textarea/><br/>
          <input type='submit' value='submit'/>
        </form>
      </div>
    );
  }
}
